import React, { useContext } from 'react'
import { AuthContext } from '../../../context/AuthContext'
import { NavLink } from 'react-router-dom';
import { Button } from '@material-ui/core';


export default function UserNavLinks() {

    const {isLoggedIn, role, userId} = useContext(AuthContext);

    return(
        <React.Fragment>
             { isLoggedIn && role === 1 &&
              <NavLink to={"/booklist/" + userId} >
                  <Button color="inherit">
                      Your Books
                  </Button>
             </NavLink> }
         { isLoggedIn &&
          <NavLink to={"/books/" + userId} >
              <Button color="inherit">
                  All Books
              </Button>
          </NavLink> }
          { isLoggedIn && <Button href="/user/login" color="inherit">Logout</Button>}

        </React.Fragment>
    )
}
